import React, { useState } from "react"
import {Link} from 'react-router-dom'
import '../CircleBtn_img/CircleBtnimg.css'


const CircleBtnsImg = (props) => {
    const [timer, setTimer] = useState({
        title: props.title,
        img: props.img,
        extra: props.class
    })

    const payment_action = () => {
        window.location.replace('/select-payment')
    }

    return (
        <span onClick={payment_action} id='link' className={`global_circle_btns box-shadow content-align ${timer.extra}`}>
            <span className='confirm_title'>{timer.title}</span>
        </span>
    )
}
export default CircleBtnsImg;
